t.add("answer.75", "The AwardWallet <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> allows users to search for merchants and identify how transactions with those merchants are coded for a credit card transaction. This is important to maximize earning the most amount of points you can with a specific credit card.<br \/>\n<br \/>\nSome of the most common bonus categories for credit card spend are grocery, gas, travel, and dining. However, not all merchant types are as easy to classify. To find out, simply search for the store in question in the Merchant Lookup Tool and it&nbsp;will display a list of confirmed credit cards that earn more than 1 point per dollar at that particular merchant.<br \/>\n<br \/>\nHere is a quick explainer video:<br \/>\n<div style=\"max-width:640px; width: 100%\">\n<div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div>\n<\/div>", "faq", "zh_CN");
t.add("question.75", "What is the AwardWallet Merchant Lookup Tool?", "faq", "zh_CN");
t.add("answer.76", "AwardWallet only uses your Gmail data to retrieve travel reservations and loyalty account statements for the purposes of making the AwardWallet&#39;s service work. AwardWallet&#39;s use of information received, and AwardWallet&#39;s transfer of information to any other app, from Google APIs will adhere to Google&#39;s Limited Use Requirements. In addition to that none of your personal data that you have stored in AwardWallet is ever transmitted to any third party without your prior explicit written consent.", "faq", "zh_CN");
t.add("question.76", "If I link my Google mailbox to AwardWallet, how does AwardWallet use the data that's in my mailbox?", "faq", "zh_CN");
